objetoCompra:
Em caráter de exclusividade, a prestação de serviços de: 
a) Recebimento, repasse, administração e o pagamento dos depósitos judiciais, inclusive precatórios e requisições de pequeno valor – RPV, sob aviso e à disposição do Tribunal de Justiça do Estado de Rondônia;
b) Guarda e aplicação da disponibilidade financeira do Tribunal de Justiça do Estado de Rondônia - TJRO e Fundo de Informatização, Edificação e Aperfeiçoamento dos Serviços Judiciários - FUJU;
c) Agente arrecadador;
d) Agente pagador;
e) Gerenciamento das contas correntes de arrecadação, pagamentos de fornecedores, recolhimento de tributos e encargos, repasses do Executivo, depósitos de garantias contratuais; e
f) Abertura de conta vinculada bloqueada para movimentação, destinada ao provisionamento de verbas trabalhistas e encargos previdenciários dos funcionários de pessoas jurídicas prestadoras de serviços em regime de dedicação exclusiva de mão de obra, alocados no Tribunal, e o provisionamento de verbas trabalhistas e previdenciárias de prepostos de Serventia Extrajudicial Vaga, sob interinidade, fiscalizada pelo Tribunal, bem como viabilizar a movimentação das contas abertas e o acesso, por meio de sistema informatizado, aos seus saldos e extratos.

O serviço de administração dos recursos especificados no subitem anterior abrangem tanto os montantes já existentes, quanto aqueles a serem acolhidos no decorrer da vigência do Contrato.

